import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

// ‚úÖ Import all components from the components folder
import Navbar from "./components/Navbar";
import Hero from "./components/Hero";
import About from "./components/About";
import Services from "./components/Services";
import Footer from "./components/Footer";
import AdminDashboard from "./components/AdminDashboard";
import CompanyProfilePage from "./components/CompanyProfilePage";

// --------------------------------------
// Global Color Variables
// --------------------------------------
const SOFT_CREAM = "#FBF9F6";
const ARM_BLUE = "#1F3B66";
const ARM_GOLD = "#D4A74B";

// --------------------------------------
// Helpers
// --------------------------------------
const getInitialView = () => {
  if (window.location.hash === "#admin-key-123") {
    return "admin";
  }
  return "public";
};

// --------------------------------------
// PageTransitionWrapper
// --------------------------------------
const PageTransitionWrapper = ({ children, isPublic }) => {
  const [animate, setAnimate] = useState(false);

  useEffect(() => {
    setAnimate(true);
  }, [isPublic]);

  return (
    <div
      className={`transition-opacity duration-500 ease-in-out ${
        animate ? "opacity-100" : "opacity-0"
      }`}
    >
      {children}
    </div>
  );
};

// --------------------------------------
// Public Layout View
// --------------------------------------
const PublicView = ({ toggleView, view }) => {
  return (
    <div className="bg-soft-cream min-h-screen">
      <Navbar toggleView={toggleView} currentView={view} />
      <main>
        <Hero />
        <About />
        <Services />
      </main>
      <Footer />
    </div>
  );
};

// --------------------------------------
// Main App Component
// --------------------------------------
export default function App() {
  const [view, setView] = useState(getInitialView());
  const currentView = view === "fading-out" ? "public" : view;

  // Toggle admin/public view
  const toggleView = (targetView) => {
    if (view === targetView) return;

    if (view === "public") {
      setView("fading-out");
      setTimeout(() => {
        window.location.hash = "admin-key-123";
        setView("admin");
      }, 500);
    } else {
      if (targetView === "admin") window.location.hash = "admin-key-123";
      else window.location.hash = "";
      setView(targetView);
    }
  };

  // Listen for URL hash changes
  useEffect(() => {
    const handleHashChange = () => {
      const newView = getInitialView();
      if (view !== newView && view !== "fading-out") {
        setView(newView);
      }
    };
    window.addEventListener("hashchange", handleHashChange);
    return () => window.removeEventListener("hashchange", handleHashChange);
  }, [view]);

  return (
    <Router>
      <div className="font-sans">
        {/* Tailwind color variables (to keep your theming consistent) */}
        <style jsx="true" global="true">{`
          :root {
            --arm-blue: ${ARM_BLUE};
            --arm-gold: ${ARM_GOLD};
            --soft-cream: ${SOFT_CREAM};
          }
          .text-arm-blue {
            color: var(--arm-blue);
          }
          .bg-arm-blue {
            background-color: var(--arm-blue);
          }
          .text-arm-gold {
            color: var(--arm-gold);
          }
          .bg-arm-gold {
            background-color: var(--arm-gold);
          }
          .bg-soft-cream {
            background-color: var(--soft-cream);
          }
        `}</style>

        <Routes>
          {/* üåê Main (Public + Admin) */}
          <Route
            path="/"
            element={
              currentView === "admin" ? (
                <AdminDashboard toggleView={toggleView} />
              ) : (
                <PageTransitionWrapper isPublic={view === "public"}>
                  <PublicView toggleView={toggleView} view={currentView} />
                </PageTransitionWrapper>
              )
            }
          />

          {/* üè¢ Company Profile Page (Standalone Page) */}
          <Route path="/company-profile" element={<CompanyProfilePage />} />

          {/* üîê Direct Admin Route (Optional Shortcut) */}
          <Route
            path="/admin"
            element={<AdminDashboard toggleView={toggleView} />}
          />
        </Routes>
      </div>
    </Router>
  );
}
